import Dropdown from "../../../components/drop-down/Dropdown"

const MenuItem = props => {
  const { item, subItems } = props

  const dropdownStyles = {
    "button" : "text-base font-nomal hover:font-bold text-nav-menu ring-gray-300",
    "items" : "w-56 origin-top-right divide-y divide-gray-100 rounded-md bg-white shadow-lg ring-1 ring-black ring-opacity-5 focus:outline-none",
    "item" : ""
  }

  return (
    <Dropdown item={item} subItems={subItems} styles={dropdownStyles}/>
  )
}

export default MenuItem
